import React from 'react';
import PropTypes from 'prop-types';
import Nav from './components/Nav';


const Section = (props) => {
  return(
    //<AboutUs />
    <section className="container-fluid h-100" >
      <Nav />
      <div className="row">
        <props.component />
      </div>
    </section>
  );
}

Section.propTypes = {
  navStyle: PropTypes.style.isRequired,
  backgroundStyle: PropTypes.style.isRequired,
  body: PropTypes.component
}


export default Section;
